('2338','2','8323','Whg. Paguera ',Null,'Mediterrane Wohnanlage auf dem Hausberg von Paguera','32971','Auf dem Hausberg von Paguera steht diese 1992 erstellte mediterrane Wohnanlage. Die sehr gepflegte Anlage bietet von fast allen Wohnungen aus einen südlich ausgerichteten Panoramablick über Paguera auf das Meer. Die hier angebotenen Studios, 2 und 3 Schlafzimmer Wohnungen haben ab 40 bis 85 m² Wohnfläche plus Terrassen. Private überdachte Autostellplätze sind bei den meisten Apartments vorhanden, ebenso ein Gemeinschaftsparkplatz innerhalb der Wohnanlage. Am Gemeinschaftspool kann man relaxen. Urlaubsvermietungen werden in dieser Wohnanlage aber nicht geduldet','32972','335000','106','2015-06-09 15:26:56','110','2015-06-09 15:27:11',Null,'2403','104','1130',1,'1','499000',Null,Null,Null,'32973',Null,'0','0','0',Null,'2016-01-29 14:09:23',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32974',Null,'32975',Null,'32976',Null,'32977',Null,'32978','0',0,'4');
